int SHIP_Y = 120;
volatile int *SW_PTR = (int *) 0xFF200040;


int main(void)
{
	
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
    clear_screen(); // pixel_buffer_start points to the pixel buffer
	//initialize asteroids
	int i;
	for (i=0;i<40;i++){
		location[i][0] = rand()%RESOLUTION_X + 60; //x pos
		location[i][1] = rand()%RESOLUTION_Y; //y pos
		location[i][2] = (rand()%3) -1; // dx
		location[i][3] = (rand()%3) -1; // dy
		
		
	}
	
	
    while (1)
    {
		clear_screen();
		
		int value = *(SW_PTR);
		if ((value & 512) == 512)
			draw_game();
		
		else if ((value & 256) == 256){
			draw_htp();
		}
		else{
			draw_menu();
		}
		
		
		
		wait_for_vsync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	}
	
	
}


void draw_menu(){
	int y_coll;
	int x_row;
	for(y_coll = 0; y_coll<RESOLUTION_Y;  y_coll++){
        for(x_row = 0;  x_row<RESOLUTION_X;  x_row++){
            if(GAlaxy_Racer[x_row + y_coll*RESOLUTION_X] != 0){
                plot_pixel(x_row, y_coll,  GAlaxy_Racer[x_row + y_coll*RESOLUTION_X]);
            }
        }
    }

}


