void draw_game(){
	draw_background();
	draw_ship(SHIP_X, SHIP_Y);
	int i;
	for (i = 0; i < NUM_AST; i ++) {
		draw_asteroids(location[i][0],location[i][1]);
	}
	move_asteroids();
	move_ship();
	check_ast_collision();
	check_ship_collision();
	
	if (SHIP_Y <= 10 || SHIP_Y >= 230 || SHIP_X >= 310 || SHIP_X <= 5){
		SHIP_Y = 120;
		SHIP_X = 20;
	}
}

void move_asteroids(){
	int i;
	for(i=0; i<NUM_AST; i++){
		
		if (location[i][0]<=5 || location[i][0]>=315){
		    location[i][2]*=-1;
		}
		if (location[i][1]<=5 || location[i][1]>=235){
		    location[i][3]*=-1;
		}
		location[i][0]+=location[i][2];
		location[i][1]+=location[i][3];
	}	
}
void move_ship(){
	int switches = *SW_PTR;
	//check what buttons are pressed
	//3 = up, 2 = down, 1 = left, 0 = right
	
	//0 or right
	if ((switches & 1) == 1){
		SHIP_X += 2;
	}
	//1 or left
	if ((switches & 2) == 2){
		SHIP_X -= 2;
	}	
	//2 or down
	if ((switches & 4) == 4){
		SHIP_Y += 2;
	}
	//3 or up
	if ((switches & 8) == 8){
		SHIP_Y -= 2;
	}
}
	
		
	
