void draw_ship(int x, int y){// given the point of the center of the rocket

	draw_rectangle(x-10, y-5,20,10);// give left most corner of the ships base
	ship_front(x,y);
	ship_side(x,y);
}

void ship_front(int x,int y){
	int i;
	for(i=5;i>0;i--){
		draw_line(x+10,y-i,x+20,y,RED);
		draw_line(x+10,y+i-1,x+20,y,RED);
	}

}
void ship_side(int x,int y){
	
	draw_line(x,y+5,x-10,y+10,WHITE);
	draw_line(x-10,y+5,x-10,y+10,WHITE);
	draw_line(x,y-5,x-10,y-10,WHITE);
	draw_line(x-10,y-5,x-10,y-10,WHITE);
}
void draw_rectangle(int x,int y,int size_x,int size_y){ // first two parameters are left most corner of the ships body, then the dimension of the ships body and the colour
	int i;
	int q;
	for(i=0;i<size_x;i++){
		for(q=0;q<size_y;q++){
			plot_pixel(x+i,y+q,GREY);
		}
	}
	
}

