int check_ast_helper(int x1, int y1, int w1, int h1, int x2, int y2, int w2, int h2)
{
    int left1, left2;
    int right1, right2;
    int top1, top2;
    int bottom1, bottom2;

    left1 = x1;
    left2 = x2;
    right1 = x1 + w1;
    right2 = x2 + w2;
    top1 = y1;
    top2 = y2;
    bottom1 = y1 + h1;
    bottom2 = y2 + h2;
	//check 4 corners for collisions
    if ((right1 > left2 && top1 < bottom2 && left1 < left2 && bottom2 < bottom1) || (right2 > left1 && top1 < bottom2 && bottom1 > bottom2 && right1 > right2) || (right1>left2 && bottom1>top2 &&left1 < left2 &&top1 < top2) || (right2>left1 &&bottom1>top2 && right1 > right2 && top1<top2)) 
    {
        return 1;
    }
	else{
		return 0;
	}
}

void check_ast_collision(){
	int i;
	int j;
	for (i = 0; i < NUM_AST; i++){
		for (j = i+1; j < NUM_AST; j++){
			//collisions then we check the 3 scenarios
			if (check_ast_helper(location[i][0], location[i][1], 5, 5, location[j][0], location[j][1], 5, 5)){
				int ast1_dx = 0, ast1_dy = 0, ast2_dx = 0, ast2_dy = 0;
				if (location[i][2] > 0){
					ast1_dx = 1;
				}
				if (location[i][3] > 0){
					ast1_dy = 1;
				}
				if (location[j][2] > 0){
					ast2_dx = 1;
				}
				if (location[j][3] > 0){
					ast2_dy = 1;
				}
				
				//first scenario 
				if (ast1_dx != ast2_dx && ast1_dy == ast2_dy){
					location[i][2] *= -1;
					location[j][2] *= -1;
				}
				else if (ast1_dx != ast2_dx && ast1_dy != ast2_dy){
					location[i][3] *=-1;
					location[j][3] *=-1;
					location[i][2] *= -1;
					location[j][2] *= -1;
				}
				else if (ast1_dx == ast2_dx && ast1_dy == ast2_dy){
					location[i][3] *=-1;
					location[j][3] *=-1;
				}
			}
		}
	}
}




